import './aitm.css'

class  Aitm extends Component {
 state = {
    name : '',
    age : ''
 }
 handleChange = (e)=>{
[e.target.id] = e
 }
    render(){

        return(
             <div>
                <form>
                    <input type="text" placeholder="name" id="name" onChange={this.handleChange}/>
                    <input type="number" placeholder="age" id="age" onChange={this.handleChange}/>
                    <input type="submit" value="Add" />
                </form>
             </div>
        )
    }

}
export default Aitm
